import './App.css';
import pokemons from './data';

const { name, image, id, averageWeight, type } = pokemons;

function App() {

  const Pokemon = () => {
    return pokemons.map((poke) => {
      return (
        <article className="Pokemon" key={id}>
          <h1>{poke.name}</h1>
          <img src={image} alt='valor'></img>
        </article>
      )
    })
  }

  return (
    <main>
      <h1>Pokedex</h1>
      <section className="Pokedex">
        <Pokemon />
      </section>
    </main>

  );
}

export default App;
